INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 0, 10040, 0.0, 24001, "リン", 1, 24, 1, 0.0, "2020/04/30 12:00:00", "あたしだって\nやるときはやるよ！");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 1, 10040, 0.0, 24002, "リン", 1, 24, 1, 0.0, "2020/04/30 12:00:00", "ふぅ…\nこれであたしの仕事は\n終わりだね");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 2, 10040, 0.0, 24003, "リン", 1, 24, 1, 0.0, "2020/04/30 12:00:00", "終わった終わった\n一人でもなんとか\nなるもんだね");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 3, 10040, 0.0, 24004, "リン", 2, 24, 2, 0.0, "2020/04/30 12:00:00", "やったね！\nこれでようやく\nサボれるよ…");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 4, 10040, 0.0, 24005, "リン", 1, 24, 1, 0.0, "2020/04/30 12:00:00", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 5, 10040, 0.0, 24006, "リン", 2, 24, 2, 0.0, "2020/04/30 12:00:00", "あたしを敵に回した\n恐ろしさ\n思い知ったか！");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 6, 10040, 0.0, 24007, "リン", 2, 24, 2, 0.0, "2020/04/30 12:00:00", "あたしも意外と\nやるもんでしょ？");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 7, 10040, 0.0, 24008, "リン", 4, 24, 4, 0.0, "2020/04/30 12:00:00", "疲れた…\nねずみの逃げ足\n速すぎるよ…");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 8, 10040, 0.0, 24009, "リン", 4, 24, 4, 0.0, "2020/04/30 12:00:00", "このままじゃ\nまっひ～に\n叱られちゃうよ");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 9, 10040, 0.0, 24010, "リン", 4, 24, 4, 0.0, "2020/04/30 12:00:00", "まじめに\nやったんだけどな…\n悔しいな～");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 10, 10040, 0.0, 24011, "リン", 4, 24, 4, 0.0, "2020/04/30 12:00:00", "やられた…\nねずみって意外と\nてごわいね");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 0.0, "2030/12/17 14:59:59", 11, 10040, 0.0, 24012, "リン", 4, 24, 4, 0.0, "2020/04/30 12:00:00", "おのれ～\nあたしのチーズを\n盗みやがって～！");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES (102601, 1.81, "2030/12/17 14:59:59", 12, 10040, 0.0, 24013, "リン", 1, 24, 4, 0.0, "2020/04/30 12:00:00", "疲れた…\nけど、次こそは\n守り抜くよ…");
